import React, { Component } from 'react'

export class ClickCounter extends Component {

    constructor(props) {
        super(props)

        this.state = {
            count: 0
        }
    }

    
  render() {
    return (
      <button onClick={this.props.incrementCount}> Clicked {this.props.count} times</button>
    )
  }
}

export default ClickCounter
